import logo from './logo.svg';
import './App.css';
import axios from 'axios';
import React, { useState } from 'react';

function App() {

  const [profileData, setProfileData] = useState(null)
  const [stockData, setStockData] = useState(null);

  function getData() {
    // axios({
    //   method: "GET",
